import React, { Component } from 'react';
import './Submenu.scss';
import SubmenuCard from '../UI/Cards/SubmenuCard/SubmenuCard';
import Img1 from '../../assets/images/cup.svg';
import Img2 from '../../assets/images/info.svg';
import Img3 from '../../assets/images/check.svg';
import Img4 from '../../assets/images/selection.svg';
import Img5 from '../../assets/images/Computer.svg';
import Img6 from '../../assets/images/screenShot.png';

export default class Submenu extends Component {
    state = { 
        images:[
            Img1,Img2,Img3,Img4,Img5,Img6
        ],
        text:{
            text1:"Ayın Projosi",
            text2:"Öneri ve İyileştirme",
            text3:"Ayın Projosi",
            text4:"Ayın Projosi",
            text5:"Ayın Projosi",
            text6:"Ayın Projosi",
        }
    };

    render() {
        return (
            <section className="Submenu">
                <div className="row">
                    <SubmenuCard cardImage={this.state.images[0]}/>
                    <SubmenuCard cardImage={this.state.images[1]}/>
                    <SubmenuCard cardImage={this.state.images[2]}/>
                    <SubmenuCard cardImage={this.state.images[3]}/>
                    <SubmenuCard cardImage={this.state.images[4]}/>
                    <SubmenuCard cardImage={this.state.images[5]}/>
                </div>
            </section>
        )
    }
}
